import Layout from "../components/Layout";
import { Document, Page } from "react-pdf";

const Resume = () => (
  <Layout>
    <div className="popup" onClick={this.handleClick}>
      <div style={{ marginLeft: "15vw" }}>
        <Document file="/files/Resume.pdf">
          <Page pageNumber={1} />
        </Document>
      </div>
    </div>
  </Layout>
);

export default Resume;
